import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';
import { ApiService } from '../api.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-create',
  templateUrl: './create.component.html',
  styleUrls: ['./create.component.scss']
})
export class CreateComponent {


constructor(private apiService:ApiService, private router:Router){}

  addFoodSubmitHandler(form:NgForm):void{
    if(form.invalid)return;

    const {foodName} = form.value;

    this.apiService.addFood(foodName).subscribe(()=>{

      this.router.navigate(['/home'])
    })



  }

}
<div class="container">
    <form class="login" #form="ngForm" (submit)="addFoodSubmitHandler(form)">

        <fieldset>
            <h3>Do you know any flavours he might be willing to try?</h3>

            <p class="field field-icon">
                <input class="input-error" type="text" name="foodName" id="foodName" placeholder="Beef and Tomato"
                ngModel #inputFood="ngModel" required minlength="4">
            </p>

            <ng-container *ngIf="false">
                <p class="error" >Flavour already exists</p>
            </ng-container>

            <button [disabled]="form.invalid">Add to Menu</button>

        </fieldset>
    </form>

</div>
